find_library(sdl2_image_library_temp
        names sdl2_image
        hints
        $env{sdl2_image_dir}
        path_suffixes lib64 lib
        paths ${sdl2_image_search_paths}
)

find_library(sdl2_library_temp
  names sdl2
  hints
  $env{sdl2dir}
  path_suffixes lib64 lib
  paths ${sdl2_search_paths}
)

find_library(sdl2main_library
      names sdl2main
      hints
      $env{sdl2dir}
      path_suffixes lib64 lib
      paths ${sdl2_search_paths}
    )

find_library(
    opengles_v1_library
    names gles glesv1_cm
    paths ${opengles_root_dir}
    hints ${pc_glesv1_cm_library_dirs}
    path_suffixes lib)

find_library(
    opengles_v2_library
    names glesv2 opengles 
    paths ${opengles_root_dir}
    hints ${pc_glesv2_library_dirs}
    path_suffixes lib)

find_library(
    opengles_v3_library
    names glesv3
    paths ${opengles_root_dir}
    hints ${pc_glesv2_library_dirs}
    path_suffixes lib)

find_library(cuda_libraries
  names cudart
  hints ${cublas_hints}
  path_suffixes lib lib64 lib/x86_64 lib/x64 lib/x86 lib/win32 lib/import lib64/import
  paths ${cublas_paths}
  doc "cuda library"
)

find_library(cublas_libraries
  names cublas
  hints ${cublas_hints}
  path_suffixes lib lib64 lib/x86_64 lib/x64 lib/x86 lib/win32 lib/import lib64/import
  paths ${cublas_paths}
  doc "cublas library"
)

find_library(pastix_${pastix_lib}_library
	names ${pastix_lib}
	hints ${pastix_dir}
	path_suffixes lib lib32 lib64)

find_library( glew_glew_library
      names glew glew32
      paths
      $env{glew_root_path}/lib
      ${opengl_library_dir}
    )

find_library(scotch_${scotch_lib}_library
	names ${scotch_lib}
	hints ${scotch_dir}
	path_suffixes lib lib32 lib64)

find_library(ptscotch_${ptscotch_lib}_library
        names ${ptscotch_lib}
        hints ${ptscotch_dir}
        path_suffixes lib lib32 lib64)

find_library(${_var}
    names ${_names}
    paths "${cuda_toolkit_root}"
    env cuda_path
    env cuda_lib_path
    path_suffixes ${_cuda_64bit_lib_dir} "${_path_ext}lib/win32" "${_path_ext}lib" "${_path_ext}libwin32"
    doc ${_doc}
    no_default_path
    )
